import React from 'react';
import { observer } from 'mobx-react';

class MobileHome extends React.Component {

  render() {
    const { users } = this.props
    return (
      <div>
        {
          users.map((user) => {
            <div>Hello</div>
          })
        }
      </div>
    );
  }
}

export default observer(MobileHome);
